import React, { Component } from 'react'
import { Navbar, NavDropdown, Form, FormControl, Button, Nav } from 'react-bootstrap'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

import Home from "./Pages1/Home";
import Atention from "./Pages1/Atention";
import Information from "./Pages1/Information";
import Login from "./Pages1/Login";
import Register from "./Pages1/Register";
import Sell from "./Pages1/Sell";
import Service from "./Pages1/Teaming";
import logo from "../img/1.png";
//import user from "../img/user.png";
import SubNav from "./SubNav";
import "../Components/NavbarComp.css";


export default class Navbar1 extends Component {
    render() {
        return (
            <Router>
                <div>

                    <Navbar bg="dark" variant={"dark"} expand="lg">
                        <Navbar.Brand href="#"><img className="img1" src={logo} /></Navbar.Brand>
                        <Navbar.Toggle aria-controls="navbarScroll" />
                        <Navbar.Collapse id="navbarScroll">
                            <Nav
                                className="mr-auto my-2 my-lg-0"
                                style={{ maxHeight: '100px' }}
                                navbarScroll
                            >
                                <Nav.Link as={Link} to="/home">Home</Nav.Link>
                                <Nav.Link as={Link} to="/Information">About</Nav.Link>
                                <Nav.Link as={Link} to="/Information">Contact</Nav.Link>

                            </Nav>

                        </Navbar.Collapse>
                    </Navbar>
                </div>
                <div>
                <Switch>
            <Route path="/Atention">
              <Atention />
            </Route>
            <Route path="/Information">
              <Information />
            </Route>
            <Route path="/">
              <Home />
            </Route>
            <Route path="/Login">
              <Login />
            </Route>
            <Route path="/Service">
              <Service />
            </Route>
            <Route path="/Register">
              <Register />
            </Route>
            <Route path="/sell">
              <Sell />
            </Route>
          </Switch>
                </div>
            </Router>
        )
    }
}
